import './Content.css';

function Content(){
    return(
        <section className="container">
            <div className="img-container">
                <img src="myImg.jpg" alt="Image"></img>
            </div>
            <div>            
                <h1>I am Marc Albert G. Bautista</h1>
            </div>
        </section>
    );
}

export default Content;
